    <div className={`frame-3663 ${className || ""}`}>
      <div className="text-5 ibmplexsans-semi-bold-monsoon-16px">{text5}</div>
      <p className="address ibmplexsans-normal-quarter-spanish-white-16px">{address}</p>
    </div>
  );
}

export default Frame3663;
